      <div className="page-header">
        <h1>
          {
            this.props.tasksProd ? 
            'Todo List - ReactJs - Production' : 'Todo List - ReactJs - '
          }
          
          <button
            type="button"
            className="btn btn-danger"
            style={{ marginLeft: '490px' }}
            onClick={this.props.resetAllData} // v59xx1
          > RESET ALL DATA
          </button>
        </h1>
      </div>
    );
  }
}

